private void attachNodeRight(Node<E> node, Node<E> newNode) {
  newNode.parent = node;
  node.right = newNode;

  newNode.prev = node;
  newNode.next = node.next;
  if (newNode.next != null) {
    newNode.next.prev = newNode;
  }
  node.next = newNode;
  balanceInsert(newNode);
}
